Traditionally the first program we write in any programming language is called a Hello World program – a program that simply outputs the text Hello World to the terminal. Let's write our first program using Ballerina. Use bal run <file_name> to run the samples. Sample Run in Playground //Binds prefix `io` to `ballerina/io` module. import ballerina/io; //The main function is the program entry point.
public function main() { // Print text to the console using `io` module `println` function. io:println("Hello World");
} Output Hello World
